            "type": "object"
        },
        "base-selection": {
            "type": "object"
        },
        "sub-panel-context": {
            "type": "object"
        }
    },
    "_viewModelId": "AwBaseSublocation",
    "_uniqueViewModelId": "AwBaseSublocation"
};

/*
